    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from the U.S. Census Bureau's Master Address File / Topologically Integrated Geographic
    Encoding and Referencing (MAF/TIGER) Database (MTDB).  The MTDB represents a seamless
    national file with no overlaps or gaps between parts, however, each TIGER/Line shapefile
    is designed to stand alone as an independent data set, or they can be combined to
    cover the entire nation.nnnThe All Roads Shapefile includes all features within
    the MTDB Super Class "Road/Path Features" distinguished where the MAF/TIGER Feature
    Classification Code (MTFCC) for the feature in MTDB that begins with "S".  This
    includes all primary, secondary, local neighborhood, and rural roads, city streets,
    vehicular trails (4wd), ramps, service drives, alleys, parking lot roads, private
    roads for service vehicles (logging, oil fields, ranches, etc.), bike paths or trails,
    bridle/horse paths, walkways/pedestrian trails, and stairways.  n",nt"license_title":
